import React, { useState } from "react";
import axios from 'axios';

// reactstrap components
import { Button, Container, Row, Col} from "reactstrap";
// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import DarkFooter from "components/Footers/DarkFooter.js";

function CampingPage() {
  const [names,setNames]=useState([]);
  const [main,setMain]=useState('first');

  React.useEffect(() => {
    function mainlist(main){
    switch (main){
    case 'first':
    return axios
      .get(
        '/api/getcamping1'
      )
      .then(Response => {
        if (Response.status === 200) {

          setNames(Response.data.response.body.items.item);
          console.log(Response.data.response.body.items.item);
          // check if this component still mounted
        }
      });
        //.catch((Error)=>{console.log(Error)});
        
    
   case'second':
   return axios
        .get(
          '/api/getcamping2'
        )
        .then(Response => {
          if (Response.status === 200) {
  
            setNames(Response.data.response.body.items.item);
            console.log(Response.data.response.body.items.item);
            // check if this component still mounted
          }
        });
          //.catch((Error)=>{console.log(Error)});
    
      case'third':
      return axios
          .get(
            '/api/getcamping3'
          )
          .then(Response => { 
            if (Response.status === 200) {
    
              setNames(Response.data.response.body.items.item);
              console.log(Response.data.response.body.items.item);
              // check if this component still mounted
          }
          });
            //.catch((Error)=>{console.log(Error)});
            case'fourth':
            return axios
            .get(
              '/api/getcamping4'
            )
            .then(Response => {
              if (Response.status === 200) {
      
                setNames(Response.data.response.body.items.item);
                console.log(Response.data.response.body.items.item);
                // check if this component still mounted
              }
            });
              //.catch((Error)=>{console.log(Error)});
              case'fifth':
            return axios
              .get(
                '/api/getcamping5'
              )
              .then(Response => {  
                if (Response.status === 200) {
        
                  setNames(Response.data.response.body.items.item);
                  console.log(Response.data.response.body.items.item);
                  // check if this component still mounted
                }
              });
                //.catch((Error)=>{console.log(Error)});
                default : 
                return <div></div>
}  
    }
  }, []);
  
  const f1=async () => {
    setMain("first");
  }
  const f2 =async () => {
      setMain("second");
    }
    const f3 =async () => {
      setMain("third");
    }
    const f4 = async() => {
      setMain("fourth");
    }
    const f5 =async () => {
      setMain("fifth");
    }
    {mainlist(location)}
  const Namelists= names.map((name)=> {
           const searchurl="https://search.daum.net/search??w=tot&&q="+ name.facltNm
           const mapurl="https://map.kakao.com/link/to/,"+name.addr1 +"," +name.mapY+","+name.mapX
        return(
          <div className="section3 section-nucleo-icons">

              <Container>
                <Row key={name.facltNm}>
                  <Col lg="6" md="12">
                    <h2 className="title">{name.facltNm}</h2>
                    <h5 className="description">
                      &nbsp;{name.doNm}&nbsp;{name.induty}{name.pageNo}
                    </h5>
                    <Button
                      className="btn-detail"
                      color="info"
                      size="lg"
                      href={searchurl}
                      target="_blank"
                    > 자세히
                    </Button>
                    <Button
                      className="btn-detail"
                      color="info"
                      href={mapurl}
                      size="lg"
                      target="_blank"
                    >
                      길찾기
                    </Button>
                  </Col>
                </Row>
              </Container>
            </div>
       );
      }
);


  return (
    <><>
      <ExamplesNavbar />
      <div className="page-header clear-filter">
        <div
          className="page-header-image"
          style={{
            backgroundImage: "url(" + require("assets/img/login1.jpg").default + ")",
          }}
        ></div>
            <div className="content-center">
          <Container>
            <h1 className="title">Camping Trip</h1>
          </Container>
        </div>
      </div>



      </><div class="zone_wrap">
        <div class="list_zone">
          <div class="tit">
          </div>
          {Namelists}
          <button type="submit"
                onClick={f1}

                >
                  1
                  </button>
            <button type="button"
                onClick={f2}
            >
                2
                </button>
                <button type="submit"
                onClick={f3}
            >
                3
                </button>
                <button type="button"
                onClick={f4}
            >
                4
                </button>
                <button type="button"
                onClick={f5}
            >
                5
                </button>
      </div>
      <DarkFooter />
      </div></>
  );
}

export default CampingPage;
